import "../tabProgressTracker.css"

export default function TabProgressTracker() {
  return (
    <div className="mainDiv">
      {/* --------Div for three buttons at top-------------- */}
      <div className="topButtons">
        <img src="./images/takeScreenshot.png" alt="button for take screenshot" />
        <img src="./images/helpCentre.png" alt="button for take help centre" />
        <img src="" alt="button for take more projects" />
      </div>
    </div>
  )
}
